  \"2013-03-28T01:14:28.903985\",\n\t\"name\": \"1-100k-digital-raster-graphic-collars-removed\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"A digital raster graphic (DRG) is a scanned
  image of an U.S. Geological Survey (USGS) standard series topographic map, including
  all map collar information. The image inside the map neatline is georeferenced to
  the surface of the earth and fit to the Universal Transverse Mercator projection.
  The horizontal positional accuracy and datum of the DRG matches the accuracy and
  datum of the source map. The map is scanned at a minimum resolution of 250 dots
  per inch. DRG's are created by scanning published paper maps on high-resolution
  scanners. The raster image is georeferenced and fit to the UTM projection. Colors
  are standardized to remove scanner limitations and artifacts. The average data set
  size is about 6 megabytes in Tagged Image File Format (TIFF) with PackBits compression.
  DRG's can be easily combined with other digital cartographic products such as digital
  elevation models (DEM) and digital orthophoto quadrangles (DOQ). DRG's are stored
  as rectified TIFF files in geoTIFF format. GeoTIFF is a relatively new TIFF image
  storage format that incorporates georeferencing information in the header. This
  allows software, such as ArcView, ARC/INFO, or EPPL7 to reference the image without
  an additional header or world file. Within the Minnesota Department of Natural Resources
  Core GIS data set the DRG's have been processed to be in compliance with departmental
  data standards (UTM Extended Zone 15, NAD83 datum) and the map collar information
  has been removed to facilitate the display of the DRG's in a seamless fashion. These
  DRG's were clipped and transformed to UTM Zone 15 using EPPL7 Raster GIS.\",\n\t\"license_title\":
